import React from "react";

class Weather extends React.Component{
    render() {
            return (
                <div className='infoWeath'>
                {!this.props.info.error &&
            <div>
                <p>Location: {this.props.info.city} {this.props.info.country}</p>
                <p>Temp: {this.props.info.temp}</p>
                <p>Pressure: {this.props.info.pressure}</p>
                <p>Sunset: { new this.props.info.sunset}</p>
            </div>
        }
        <p>{this.props.info.error}</p>
            </div>
            );
    }
}

export default Weather;
